    from CTD and XBT casts from the L. MCCORMICK and other platforms as part of the
    Marine Resources Monitoring, Assessment and Prediction (MARMAP) project from 1981-09-14
    to 1983-03-05 (NODC Accession 8300038)",nt"tracking_summary": {ntt"total":
    1,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-10-04T01:55:11.864993",nt"name": "physical-temperature-profile-and-other-data-from-ctd-and-xbt-casts-from-the-l-mccormick-and-oth",nt"isopen":
    false,nt"url": null,nt"notes": "Physical, temperature profile, and other
    data were collected from CTD and XBT casts from the L. MCCORMICK and other platforms
    from 14 September 1981 to 05 March 1983. Data were collected by the National Marine
    Fisheries Service (NMFS) and other institutions as part of the Marine Resources
    Monitoring, Assessment and Prediction (MARMAP) and WARM CORE RINGS projects. Data
    were processed by NODC to the NODC standard High-Resolution CTD/STD Output(F022)
    and the Universal bathythermograph Output (UBT) formats. Full format descriptions
    are available from the NODC homepage at www.nodc.noaa.gov/.nnThis F022 format contains
    high-resolution data collected using CTD (conductivity-temperature-depth) and STD
    (salinity-temperature-depth) instruments. As they are lowered and raised in the
    oceans, these electronic devices provide nearly continuous profiles of temperature,
    salinity, and other parameters. Data values may be subject to averaging or filtering
    or obtained by interpolation and may be reported at depth intervals as fine as 1m.
    Cruise and instrument information, position, date, time and sampling interval are
    reported for each station. Environmental data at the time of the cast (meteorological
    and sea surface conditions) may also be reported. The data record comprises values
    of temperature, salinity or conductivity, density (computed sigma-t), and possibly
    dissolved oxygen or transmissivity at specified depth or pressure levels. Data may
    be reported at either equally or unequally spaced depth or pressure intervals. A
    text record is available for comments.nnThe UBT format contains temperature-depth
    profile data obtained using expendable bathythermograph (XBT) instruments. Cruise
    information, position, date and time were reported for each observation. The data
    records are comprised of pairs of temperature-depth values. The XBT data files contain
    temperature values at non-uniform depths. These depths were recorded at the minimum
    number of points ("inflection points") required to accurately define the temperature
    curve.nStandard XBTs can obtain profiles to depths of 450 m or 760 m. Special instruments
    permitted measurements to 1830 m.",nt"license_title": null,nt"extras":
